import ExpenseItem from "./ExpenseItem";
import App from "../App";
import "./Expense.css";

function Expense(props) {
    
  return (
    <div className="expenses">
      <ExpenseItem
        title={props[0].title}
        amount={App()[0].amount}
        date={App()[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={App[1].title}
        amount={App[1].amount}
        date={App[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={App[2].title}
        amount={App[2].amount}
        date={App[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={App[3].title}
        amount={App[3].amount}
        date={App[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default Expense;
